  \"A Magnetic Thermometer for High-Resolution 10 mK Scale Thermometry Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:08:43.733776\",\n\t\"name\": \"a-magnetic-thermometer-for-high-resolution-10-mk-scale-thermometry-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"An innovative thin-film magnetic thermometer
  with integrated superconducting quantum interference device (SQUID) readout is described
  for fast, precision temperature measurements in the 10 mK range. The compact thermometer
  consists of a miniature DC SQUID susceptometer with a dilute paramagnetic alloy
  deposited in one of the two series-configured gradiometric SQUID pickup loops that
  form the SQUID inductance. Directly sensing the magnetic signal with the SQUID eliminates
  losses that would otherwise occur by transformer-coupling the signal to a remotely
  located SQUID, usually operating at a higher temperature and consequently with a
  higher noise floor. In addition, a novel superconducting flux concentrator deposited
  on top of the paramagnetic alloy homogenizes and concentrates the magnetic flux
  density in the paramagnet and reduces the inductance of the pickup coil, both of
  which improve the sensitivity and signal to noise ratio as compared with previous
  miniature susceptometer designs. The innovative magnetic thermometer design is expected
  to achive a temperature resolution well below 1 5K/Hz=. \",\n\t\"license_title\":
